                if (var_x2c1.get(var_ngdn - 1) <= var_00bl && var_x2c1.get(var_ngdn - 1) > 0) {
                    dp[var_00bl][var_ngdn] += dp[var_00bl / var_x2c1.get(var_ngdn - 1)][var_ngdn - 1] + 1;
